import React, { Component } from "react";
import {Link} from "react-router-dom";
import "./Banner.css"

export default class Banner extends Component{

    render() {
        return (
        <div id="banner">
            <div id="logo">
                <Link to="/">
                    <h1>Kasa</h1>
                </Link>
            </div>
            <ul id="links">
                <Link to="/"><li className="link">Accueil</li></Link>
                <Link to="/a-propos"><li className="link">A propos</li></Link>
            </ul>
        </div>
        )
    }
}
